import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  containerConfig: {
    backgroundColor: "#FFF2D8",
    height: "100%",
  },
  navConfig: {
    backgroundColor: "#D5ECB4",
  },
  inputs: {
    alignItems: "center",
    justifyContent: "center",
  },
  inputConfigNome: {
    backgroundColor: "white",
    width: "330px",
    borderTopRightRadius: "20px",
    borderTopLeftRadius: "20px",
  },
  inputConfigEmail: {
    backgroundColor: "white",
    width: "330px",
  },
  inputConfigSenha: {
    backgroundColor: "white",
    width: "330px",
    borderBottomStartRadius: "20px",
    borderBottomEndRadius: "20px",
  },

  textTermos: {
    fontSize: "15px",
    fontFamily: "sansSerif",
    color: "black",
    marginRight: "220px",
  },
  textLicencas: {
    fontSize: "15px",
    fontFamily: "sansSerif",
    color: "black",
    marginRight: "220px",
  },
  tituloConfig1: {
    marginTop:'30px',
    fontFamily: "sansSerif",
    marginBottom: "10px",
    fontWeight: "bold",
    fontSize: "20px",
    textAlign: "center",
  },
  tituloConfig2: {
    fontFamily: "sansSerif",
    marginBottom: "10px",
    fontWeight: "bold",
    fontSize: "20px",
    textAlign: "center",
  },
  buttonConfigTermos: {
    backgroundColor: "#F1C4A5",
    marginLeft: "20px",
    width: "240px",
    marginTop: "15px",
    borderRadius: "15px",
  },
  buttons: {
    flex: "1",
    flexDirection: "row",
    justifyContent: "space-evenly",
    alignItens: "center",
    marginTop: "20px",
  },
  button1: {
    backgroundColor: "#D5ECB6",
    border: "3px solid #44712F",
  },
  button2: {
    backgroundColor: "#E08181",
    border: "3px solid #C63F3F",
  },
  textSal: {
    fontFamily: "sansSerif",
    fontWeight: "bold",
    color: "black",
  },
  textDel: {
    fontFamily: "sansSerif",
    fontWeight: "bold",
    color: "black",
  },
});
